import './App.css';
import { Parallax, ParallaxLayer } from '@react-spring/parallax';
import React from 'react';
import { HeroSection } from './HeroSection';
import InfoCards from './InfoCards';
import sand from './sand.png';
import sand1 from './sand2.png';
import girl from './girl.png';
import gs from './goldmansachs_logo.png';

const url = (name, wrap = false) =>
  `${wrap ? 'url(' : ''}https://awv3node-homepage.surge.sh/build/assets/${name}.svg${wrap ? ')' : ''}`
function App() {

  const internships = [
    {
      title: "Goldman Sachs",
      body: "Developed a web application to decommission a legacy trading system in the Asset Management team.|Developed REST APIs for retrieving shares, facilitating transactions, and ensuring timely deployment through streamlined teamwork and coordination.|Utilized Agile methodology and collaborated with traders to achieve consensus on design direction",
      techstack: "Languages/Tools: Java, Kotlin, Ruby, SQL, Git, Adyen, Prometheus.",
      image: gs
    },
    {
      title: "Zipcar",
      body: "This is the second paragraph for Zipcar internship.",
      image: "zipcar_image_url"
    }
  ];
  const projects1 = [
    {
      title: "Goldman Sachs",
      body: "This is the first paragraph for Goldman Sachs internship.",
      image: "goldman_sachs_image_url"
    },
    {
      title: "Zipcar",
      body: "This is the second paragraph for Zipcar internship.",
      image: "zipcar_image_url"
    }
  ];

  const projects2 = [
    {
      title: "Zipcar",
      body: "This is the second paragraph for Zipcar internship.",
      image: "zipcar_image_url"
    },{
      title: "Zipcar",
      body: "This is the second paragraph for Zipcar internship.",
      image: "zipcar_image_url"
    }
  ];

  const alignCenter = { display: 'flex', alignItems: 'center' }

  return (
    <div className="flex-container">
      <Parallax pages={3.5}>
        {/* setting background color */}
        <div className="flex-item1">
          <ParallaxLayer
            offset={0}
            speed={0}
            factor={3.5}
            style={{ background: 'linear-gradient(to bottom, #7bb2ff, #e0ffff)'}}
          ></ParallaxLayer>
        </div>

        {/* parachute girl */}
        <ParallaxLayer offset={0.3} speed={-1} className="top-layer">
        <div className= "card" >
            <img src={girl} style={{marginLeft:'20%', maxWidth: '100%', height: 'auto' }} />
          </div>
        </ParallaxLayer>   

        {/* Hero Section component */}
        <ParallaxLayer
          offset={0.35}
          speed={0.1}
          >
          <div style={{ display: 'inline-block', marginLeft:'45%'}}>
           <HeroSection/>
          </div>
        </ParallaxLayer>

        {/* Experience Component */}
        <ParallaxLayer
          offset={1}
          speed={0.1}
          >
          <div className="top-layer" style={{ display: 'inline-block', marginLeft:'45%'}}>
            <div className="top-layer" style={{ marginBottom: '30px' }}>
              <h1>Experience</h1>
              <InfoCards info = {internships} width="350"/>
            </div>
          </div>
        </ParallaxLayer>

        {/* Projects Component */}
        <ParallaxLayer
          offset={2}
          speed={0.1}
          >
          <div className="top-layer" style={{ display: 'inline-block', marginLeft:'45%'} }>
            <div className="top-layer" style={{ marginBottom: '20px' }}>
            <h1>Projects</h1>
              <InfoCards info ={projects1} width="300"/>
            </div>
            <div style={{ marginBottom: '20px' }}>
            <InfoCards info = {projects2} width="300"/>
            </div>
          </div>
        </ParallaxLayer>

        {/* Sand  */}
        <ParallaxLayer offset={3.0} speed={0.4} >
          <img src={sand} style={{ display: 'block', width: '100%' , height: '30%'}} />
        </ParallaxLayer>
        <ParallaxLayer offset={3.0} speed={0.4} >
          <img src={sand1} style={{ display: 'block', width: '100%', height: '30%'}} />
        </ParallaxLayer>

        {/* Clouds */}
        <ParallaxLayer offset={0} speed={0.8} style={{ opacity: 0.2 }}>
          <img src={url('cloud')} style={{ display: 'block', width: '20%', marginLeft: '55%' }} />
          <img src={url('cloud')} style={{ display: 'block', width: '10%', marginLeft: '15%' }} />
        </ParallaxLayer>

        <ParallaxLayer offset={0.75} speed={0.5} style={{ opacity: 0.1 }}>
          <img src={url('cloud')} style={{ display: 'block', width: '20%', marginLeft: '70%' }} />
          <img src={url('cloud')} style={{ display: 'block', width: '20%', marginLeft: '40%' }} />
        </ParallaxLayer>

        <ParallaxLayer offset={0} speed={0.2} style={{ opacity: 0.2 }}>
          <img src={url('cloud')} style={{ display: 'block', width: '10%', marginLeft: '10%' }} />
          <img src={url('cloud')} style={{ display: 'block', width: '20%', marginLeft: '75%' }} />
        </ParallaxLayer>

        <ParallaxLayer offset={0.6} speed={-0.1} style={{ opacity: 0.4 }}>
          <img src={url('cloud')} style={{ display: 'block', width: '20%', marginLeft: '60%' }} />
          <img src={url('cloud')} style={{ display: 'block', width: '25%', marginLeft: '30%' }} />
          <img src={url('cloud')} style={{ display: 'block', width: '10%', marginLeft: '80%' }} />
        </ParallaxLayer>

        <ParallaxLayer offset={1.6} speed={0.4} style={{ opacity: 0.6 }}>
          <img src={url('cloud')} style={{ display: 'block', width: '20%', marginLeft: '5%' }} />
          <img src={url('cloud')} style={{ display: 'block', width: '15%', marginLeft: '75%' }} />
        </ParallaxLayer>

        <ParallaxLayer offset={2.0} speed={0.4} style={{ opacity: 0.6 }}>
          <img src={url('cloud')} style={{ display: 'block', width: '20%', marginLeft: '5%' }} />
          <img src={url('cloud')} style={{ display: 'block', width: '15%', marginLeft: '35%' }} />
        </ParallaxLayer>

        <ParallaxLayer offset={3.8} speed={0.4} style={{ opacity: 0.3 }}>
          <img src={url('cloud')} style={{ display: 'block', width: '20%', marginLeft: '15%' }} />
          <img src={url('cloud')} style={{ display: 'block', width: '15%', marginLeft: '85%' }} />
        </ParallaxLayer>
      </Parallax>
    </div>
  );
}

export default App;
